signatures: >-
  executeAgentCommand(agentDirectoryPath:string, args:Array.<string>) :
  Promise.<string> - Executes a faqtiv CLI command in the specified agent
  directory. Rejects if the agent directory doesn't exist or if the command
  fails. Resolves with the command's stdout output or stderr if stdout is empty.

  fetchYamlApiSpec(apiUrl:string) : Promise.<Object> - Fetches the API spec from
  the given URL and parses it using Swagger-Parser. Resolves with the parsed API
  spec object or throws an error if fetching or parsing fails.
